import Button from './components/Button';

function App() {

  const numbers = [{
    number: 7, 
    numWord: "seven"
  },
  { number: 8, 
    numWord: "seven"
  },
  { number: 9, 
    numWord: "nine"
  },
  { number: 4, 
    numWord: "four"
  },
  { number: 5, 
    numWord: "five"
  },
  { number: 6, 
    numWord: "six"
  },
  { number: 6, 
    numWord: "six"
  },
  { number: 6, 
    numWord: "six"
  },
  { number: 6, 
    numWord: "six"
  }];
  const makeButtons = numbers.map(number => (
    <Button number={number.number} />
  ))

  return (
    <div className="App">
      <p>
        This is a calculator
      </p>
      {makeButtons}
    </div>
  );
}

export default App;
